# MAGIC %md ## Resolution for H3 Grids
# MAGIC
# MAGIC > If a plane is flying at ~483 kph (300 mph), then it covers ~8 km (5 mi) per minute or ~4 km (2.5 mi) per 30 seconds or 2 km (1.25 mi) per 15 seconds which is near the interval of flight data reporting. H3 resolutions around 8 at .737 km^2 would be useful for straight track distances; however, __since we are looking at holding patterns, will use resolution 6 for the initial analysis.__
# MAGIC
# MAGIC > 
# MAGIC
# MAGIC | H3 Resolution | Average Hexagon Area (km2) | Average Hexagon Edge Length (km) | Number of unique indexes |
# MAGIC | ------------- | -------------------------- | -------------------------------- | ------------------------ |
# MAGIC |0 |4,250,546.8477000|1,107.712591000|122|
# MAGIC |1 |607,220.9782429  |418.676005500|842|
# MAGIC |2 |86,745.8540347   |158.244655800|5,882|
# MAGIC |3 |12,392.2648621   |59.810857940|41,162|
