# MAGIC |8 |0.7373276        |0.461354684|691,776,122|
# MAGIC |9 |0.1053325        |0.174375668|4,842,432,842|
# MAGIC |10|0.0150475        |0.065907807|33,897,029,882|
# MAGIC |11|0.0021496        |0.024910561|237,279,209,162|
