# MAGIC %md ### H3 Resolution 6 DataFrame `df_hex6`
# MAGIC
# MAGIC * `h3_longlatash3` to get latitude and longitude H3 cell
# MAGIC * `h3_centeraswkt` to get the centroid of the H3 cell as WKT (Well Known Text)

# COMMAND ----------

df_hex6 =  (
    df
        .withColumn("h3_resolution", F.lit(6))
        .withColumn("hex_id", h3_longlatash3("longitude", "latitude", 6))
        .withColumn("hex_centroid", h3_centeraswkt("hex_id"))
    .select(*df.columns,"hex_id","hex_centroid","h3_resolution")
)

display(df_hex6)

