# MAGIC %md ## Window Function for Distances between Messages
# MAGIC
# MAGIC > H3 has an API for calculating distances. Let's first see how far we get with just Spark Windowing with distances based on H3 resolution 8.
# MAGIC
# MAGIC * `h3_distance`: Returns the distance in grid cells between the two indexes; km based on resolution ([here](https://h3geo.org/docs/api/traversal#h3distance)).

# COMMAND ----------

display(
    df_hex6
        .withColumn("hex_lag", F.lag("hex_id",5).over(Window.orderBy("dt_rank")))
        .withColumn("hex_lag_dist", h3_distance("hex_id", "hex_lag"))
            .filter("mph > 275")
        .orderBy("dt_rank")
)

